import React from "react";
import ReactDOM from "react-dom";
import Header from "./Header"

function Page() {
  return (
    <div>
      <Header />
      <MainContent />
      <Footer />
    </div>
  );
}

ReactDOM.render(<Page />, document.getElementById("root"));
